import React from "react";
// import Profilphoto from "../images/photoprofil.webp";

import { NavLink } from "react-router-dom";

const Navigation = () => {
  let myNavigation =
    " col-xl-3 myNavigation text-center p-5 text-light d-flex flex-column align-middle";
  let navItem = "nav-item p-4  ";
  let navLinkStyle = "text-decoration-none text-light display-6 ";

  const iconR = (intitule, reseauxS) => {
    let reseauSocial = intitule + reseauxS + " display-1 mx-3";
    return reseauSocial;
  };

  return (
    <div className={myNavigation}>
      <div className="items">
        <ul className="nav d-flex flex-column list-group text-light ">
          <NavLink exact to="/" className={navLinkStyle}>
            <li className={navItem}>
              <i className="fas fa-home"></i> Acceuil
            </li>
          </NavLink>

          <NavLink exact to="/knowledges" className={navLinkStyle}>
            <li className={navItem}>
              <i className="fab fa-angellist"></i> Exp & For
            </li>
          </NavLink>

          <NavLink exact to="/portfolio" className={navLinkStyle}>
            <li className={navItem}>
              {" "}
              <i className="far fa-images"></i> Portfolio
            </li>
          </NavLink>

          <NavLink exact to="/contact" className={navLinkStyle}>
            <li className={navItem}>
              <i className="far fa-id-card"></i> Contact
            </li>
          </NavLink>
        </ul>
      </div>

      <div className="d-flex">
        <i className={iconR("fab fa-", "facebook")}></i>
        <i className={iconR("fab fa-", "github")}></i>
        <i className={iconR("fab fa-", "linkedin")}></i>
      </div>
    </div>
  );
};

export default Navigation;
